/*
 Returns a pointer to the first occurrence of needle in haystack, or null if needle is not part of haystack.
* */

function strStr(hackstack, needle){
    if(hackstack.length === 0 && needle.length === 0)return 0;
    if(hackstack.length<needle.length)return -1;

    for(var i= 0;i<hackstack.length;i++){
        if(hackstack.length - i+1 < needle.length)return -1;
        for(var j=0;j<needle.length; j++){
            if((i+j) >= hackstack.length || hackstack[i+j]!==needle[j]){
                break;
            }
        }
        if(j==needle.length)return i;
    }

    return -1;

}

module.exports = strStr;

var a = "";
var b = "";

console.log(strStr(a, b));